require(['jquery'], function ($) {

  // attach consent module widget to #consents-block on patient sheet
  document.observe("phenotips:consentmodule:defined", function ()
  {
    var consentsBlock = $('#consents-block');
    if (consentsBlock.length == 1 && !consentsBlock[0].initialized) {
      var action = consentsBlock.attr("class");
      var assignConsentsUrl = consentsBlock.attr("assign-url");
      var consents = {};
      try {
        consents = JSON.parse($('#patient-consents-json').attr('value'));
      } catch(err) {
        console && console.error(err);
      }

      var consentsModule = PhenoTips.widgets.ConsentsModule.createNew();
      consentsModule.init(consentsBlock, action, consents, true, null, consentsBlock);

      consentsBlock[0].initialized = true;

      // attach button action
      var onUpdateButtonPress = function(event) {
        event.stop();
        var errorMessage = consentsBlock.children(".error_updating_consents");
        errorMessage.addClass("hidden");

        var errorUpdatingConsents = function() {
          errorMessage.removeClass("hidden");
        };
        var afterConsentsUpdated = function() {
          window.location.reload();
        }
        var grantedConsents = consentsModule.listGrantedConsentIDs();
        var consentIdsJSON = JSON.stringify(grantedConsents);
        $.ajax(assignConsentsUrl, {data: consentIdsJSON, dataType: "text", method: "PUT", contentType: "application/json;charset=UTF-8"})
          .fail(errorUpdatingConsents)
          .success(afterConsentsUpdated);
      }
      var button = $('#patient-consent-update')[0];
      if (button) {
        button.observe('click', onUpdateButtonPress);
      }
    }
  });
});

window.PhenoTips = (function (PhenoTips)
{
  var widgets = PhenoTips.widgets = PhenoTips.widgets || {};
  /* hack; otherwise loading order for push is wrong */
  var consentsModule = {};
  require(['jquery'], function ($)
  {
    consentsModule.createNew = function ()
    {
      return {
        consentIdSuffix: "-consent-checkbox",

        classVariables: {
          consentsBlock: null,
          errorBlock: null,
          displayDetails: true,
          consentChangeCallback: null,
          action: null
        },

        /**
         * @param callback function fired when the consent are successfully loaded and displayed
         * @param errorBlock (optional) an HTML block which may have elements with the following IDs, which
         *        (if present) are displayed and hidden depending on the state of consent data:
         *        "#patient-consent-update" - supposedly an "update" button, hidden when any errors in consent data are present
         *        ".view-title-required-not-granted" - a block shown when a required consent is not granted (in view mode)
         *        ".error_no_consent_data" - a block (supposedly with an error message) displayed when no consent data was passed to the script
         */
        init: function (consentsBlock, action, consents, displayDetails, consentChangeCallback, errorBlock)
        {
          this.classVariables.consentsBlock = $(consentsBlock);
          this.classVariables.errorBlock = errorBlock ? $(errorBlock) : null;
          this.classVariables.displayDetails = displayDetails;
          this.classVariables.consentChangeCallback = consentChangeCallback;
          this.classVariables.action = action;

          this.displayConsents(consents);
        },

        // If the consents object is empty, or undefined or false in any way, then it is assumed that an error has occurred.
        displayConsents: function(consents) {
          if (consents && consents.length > 0) {
            this.drawConsents(this.classVariables.consentsBlock, this.classVariables.action, consents);
            if (this.classVariables.consentChangeCallback) {
              this.attachStateChangeCallbacks(this.classVariables.consentChangeCallback);
            }
            this.clearError(".error_no_consent_data", true);
          } else {
            this.displayError(".error_no_consent_data", true);
          }
          this.classVariables.consentsBlock.show();
        },

        drawConsents: function (consentsBlock, action, consents)
        {
          var consentList = consentsBlock.children(".consents");
          if (consentList.length == 0) {
            consentList = $("<div class='consents'>");
            consentsBlock.append(consentList);
          }
          var list;
          if (action == "edit") {
            var _this = this;
            list = $.map(consents, function (consent)
            {
              return _this.displayGrantableConsent(consent);
            })
          } else if (action == "view") {
            var granted = this.filterGranted(consents);
            this.displayApplicableWarnings(consents);
            list = granted.map(this.displayConsentLabel);
          }

          if (list) {
            var listHtml = $("<ul class='consents-list'>");
            list.each(function (c)
            {
              listHtml.append(c);
            });
            listHtml.append("</ul>");
            consentList.html(listHtml);
          }
        },

        /** @return the list of ids, whose corresponding checkboxes are checked */
        listGrantedConsentIDs: function()
        {
          return this.listConsentIDs(true, false);
        },

        /** @return the list of ids, whose corresponding checkboxes are un-checked */
        listNotGrantedConsentIDs: function()
        {
          return this.listConsentIDs(false, true);
        },

        listConsentIDs: function(includeGranted, includeNotGranted)
        {
          if (!this.classVariables.consentsBlock) {
            return [];
          }
          var _this = this;
          var checked = this.classVariables.consentsBlock.find("input[type=checkbox]").filter(function(i, ch){
            return (includeGranted && $(ch).is(":checked")) || (includeNotGranted && !$(ch).is(":checked"));
          });
          return checked.map(function(i, ch) {
            var id = $(ch).attr("id");
            return id.replace(_this.consentIdSuffix, "");
          }).get();
        },

        allRequiredChecked: function() {
          if (!this.classVariables.consentsBlock) {
            return true;
          }
          var requiredUnchecked = this.classVariables.consentsBlock.find("li.required input[type=checkbox]:not(:checked)");
          return (requiredUnchecked.length == 0);
        },

        attachStateChangeCallbacks: function(callback)
        {
          var _this = this;
          var consentList = $(".consents");
          consentList.on("change", "li input", function (event)
          {
            var checkbox = $(event.target);
            var name = checkbox.attr("data-bind");
            if (checkbox.is(":checked")) {
              callback(name, true);
            } else {
              callback(name, false);
            }
          })
        },

        filterGranted: function (consents)
        {
          return consents.filter(function (c)
          {
            return c.status == "yes";
          })
        },

        /* Display util functions */

        displayConsentLabel: function (consent)
        {
          return $("<li class='consent-label " + (consent.isRequired ? " required":"") + "'>" + consent.label + (consent.isRequired ? " $!escapetool.javascript($services.localization.render('phenotips.consents.label.required'))":"") + "</li>");
        },

        displayConsentDescription: function (consent)
        {
          return $("<li class='consent-description'>" + consent.description + "</li>");
        },

        displayGrantableConsent: function (consent)
        {
          var checkbox = $("<input type='checkbox' class='consent-checkbox'>")
            .attr("id", consent.id + this.consentIdSuffix)
            .attr("data-bind", consent.id);
          if (consent.status == "yes") {
            checkbox.attr("checked", "checked");
          }
          var labelHTML = "<label></label>";
          var label = this.displayConsentLabel(consent).prepend(checkbox).wrapInner(labelHTML);
          if (this.classVariables.displayDetails && consent.description && consent.description.length > 0) {
            return label.add(this.displayConsentDescription(consent));
          } else {
            return label;
          }
        },

        displayApplicableWarnings: function (consents)
        {
          // only display warnings if this instance is configured to do so
          if (!this.classVariables.errorBlock) {
            return;
          }

          // go over all consents
          // - If some required are not granted display the error message.
          // Independently:
          //  - if none are granted display the message
          //  - if some are granted display them

          var noneGranted = true;
          var requiredNotGranted = false;

          for (var i = 0; i < consents.length; i++) {
            if (consents[i].status != "no") {
              noneGranted = false;
            } else if (consents[i].isRequired) {
              requiredNotGranted = true;
            }
          }

          // reset
          this.classVariables.errorBlock.children('.view-title-required-not-granted').addClass('hidden');
          this.classVariables.consentsBlock.removeClass('hidden');

          if (requiredNotGranted) {
            this.classVariables.errorBlock.children('.view-title-required-not-granted').removeClass('hidden');
          } else if (noneGranted) {
            this.classVariables.consentsBlock.addClass('hidden');
          }
        },

        displayError: function (errorClassString, disableUpdateButton)
        {
          if (!this.classVariables.errorBlock) {
            return;
          }

          if (disableUpdateButton) {
           var updateButton = this.classVariables.errorBlock.children('#patient-consent-update');
           updateButton && updateButton.addClass("hidden");
          }

          var errorBlock = this.classVariables.errorBlock.children(errorClassString);
          errorBlock.removeClass("hidden");
        },

        clearError: function (errorClassString, enableUpdateButton)
        {
          if (!this.classVariables.errorBlock) {
            return;
          }

          if (enableUpdateButton) {
           var updateButton = this.classVariables.errorBlock.children('#patient-consent-update');
           updateButton && updateButton.removeClass("hidden");
          }

          var errorBlock = this.classVariables.errorBlock.children(errorClassString);
          errorBlock.addClass("hidden");
        }
      }
    };
    // In some cases users of the widget may like to use it as soon as possible to minimize UI flicker;
    // firing an event guarantees that users may start using it as soon as it is defined.
    document.fire("phenotips:consentmodule:defined");
  });

  widgets.ConsentsModule = consentsModule;
  return PhenoTips;
})(window.PhenoTips || {});

